import React from "react";
import companyLogo from "../../assets/logo-search-grid-1x.png";
export default function logo() {
  return (
    <>
      <style>.logo{{ height: '200px', width: '300px'}}</style>
      <img className="logo" src={companyLogo} alt="BigCo Inc. logo" />
    </>
  );
}
